import styled from "styled-components";
export const FooterWrapper = styled.div`
    background: #171717;
    padding: 2rem .15rem;
    .footer-left {
        color: #fff;
        .descript-footer {
            margin: 1rem;
            text-align: justify;
        }
    }
`
export const FooterItems = styled.li`
    
`
